import React from 'react';
import MapContainer from './components/MapContainer'; // Updated to the correct path
import BookingForm from './components/BookingForm'; // Updated to the correct path
import './styles/App.css'; // Updated to the correct path

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="./assets/logo.png" alt="Logo" className="App-logo" />
        <h1>Car Rescue Service</h1>
        <p>Your trusted partner for roadside assistance</p>
      </header>

      <section className="App-body">
        <MapContainer />
        <BookingForm />
      </section>

      <footer className="App-footer">
        <p>&copy; 2025 Car Rescue Service. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
